import React from 'react'

export default function Feedback() {
    return (
        <div className='feedback'>
            <span className = "feedback-title">Форма обратной связи:</span>
            <input className = 'feedback-input'>ФИО</input>
            <input className = 'feedback-input'>E-Mail</input>
            <input className = 'feedback-input'>Номер телефона</input>
            <div className = 'feedback-button'></div>
        </div>
    )
}
